NEWBIE_TOOLTIP_RANK = "El rango es el resultado final del sistema para calcular el honor. Basándose en una comparación de tu estatus de la semana y tu rango actual, puedes subir, bajar o mantenerte. Los jugadores con un nivel de juego superior suben de rango más rápido (y caen más lentamente) que los jugadores con niveles inferiores. Además, el rango aumenta con más rapidez en rangos inferiores que en los superiores.";
NEWBIE_TOOLTIP_HONORABLE_KILLS = "Cada vez que tú o tu grupo inflige daño a un jugador en JcJ que termine muriendo obtendrás puntos por muerte con honor. Solo obtendrás puntos por muerte con honor si acabas con jugadores de dificultad color verde o superior (lo equivalente a los monstruos que te dan experiencia). Las muertes con honor solo las obtendrás al acabar con jugadores enemigos.";
NEWBIE_TOOLTIP_DISHONORABLE_KILLS = "Cada vez que contribuyas a atacar a un civil en JcJ que tenga un nivel tan bajo que no te dé experiencia (un número gris de nivel) recibirás un punto por muerte sin honor. Cada muerte sin honor reducirá inmediatamente un poco tu posición general, y cada una de las subsiguientes que realices en un mismo día tendrá un efecto cada vez más negativo. Este tipo de muertes cuentan directamente sobre tu posición.";
NEWBIE_TOOLTIP_HONOR_CONTRIBUTION_POINTS = "Ganas honor matando con honor durante los combates entre jugadores (JcJ). La cantidad de honor que ganas por muerte depende del daño que tú (o tu grupo) infligiste al jugador eliminado. Cuanto más daño le inflijas, más honor recibirás. El honor conseguido se dividirá entre los miembros del grupo o la banda. Además, ganarás menos honor si ganas al mismo jugador una y otra vez en poco tiempo. Así que tras matar al mismo jugador varias veces, recibirás mucho menos o dejarás de recibir honor.";
NEWBIE_TOOLTIP_HONOR_STANDING = "La Posición es tu puntuación comparada con todos los demás jugadores de tu bando (Horda o Alianza). Si tu posición es 150, entonces tienes a 149 jugadores delante que obtuvieron más honor durante el mismo período de tiempo. Para subir en posición y rango debes conseguir al menos 15 muertes con honor.";
