WINTERGRASP_DESCRIPTION = "Una antigua fortaleza de los titanes construida para proteger La Cámara de Archavon. Las fuerzas de la Horda y de la Alianza se enfrentan con dureza por el control del lugar, ansiosos por tomar los artefactos y las reliquias que guarda la cámara para su batalla contra el Rey Exánime.\n\nLos ingenieros gnomos y goblins trabajan sin parar en talleres improvisados para producir las poderosas máquinas de asedio que los atacantes necesitarán para echar abajo las murallas y torres de la fortaleza.\n\n";
TOL_BARAD_DESCRIPTION = "Tol Barad, una de las ciudadelas de Stromgarde situada en una isla, fue arrasada y más tarde abandonada por orcos devastadores en la Segunda Guerra. Años después Kul Tiras reclamó la isla y un grupo de brujos supervisó la construcción de una gran prisión mágica sobre las ruinas de la fortaleza.\n\nDurante una batalla a gran escala, el equipo atacante deberá controlar simultáneamente el Cuartel del Acorazado, la Vigilia del Celador y los Rescoldos para lograr la victoria. Las fuerzas atacantes deberán usar vehículos de asedio abandonados para destruir las tres torres de vigilancia, extendiendo así la duración de la batalla.\n\n";
