HELPFRAME_REPORT_BUG_TITLE = "Enviar error";
HELPFRAME_REPORT_BUG_TEXT1 = "Si has encontrado un error, necesitaremos todos los detalles posibles para encontrarlo y corregirlo. Describe el problema en el campo de texto:\n\n-|cffffd200Sé específico|r sobre cada uno de los pasos que provocan el problema.\n-Incluye cualquier |cffffd200nombre de personaje, PNJ y lugar|r relevantes.\n-|cffffd200Evita las erratas y las abreviaciones|r: esto hace más difícil encontrar los errores.\n-Incluye |cffffd200desde cuándo|r ves este problema y |cffffd200con qué frecuencia|r (si lo has visto más de una vez).";
HELPFRAME_SUBMIT_SUGGESTION_TITLE = "Enviar sugerencia";
HELPFRAME_SUBMIT_SUGGESTION_TEXT1 = "Los comentarios de los jugadores ayudan a que el equipo de World of Warcraft tenga la oportunidad de mejorar todos los aspectos del juego.\n\nSi decides enviar una sugerencia, |cffffd200por favor, especifica|r y |cffffd200organiza tus ideas|r de |cffffd200forma constructiva|r:\n\n-¿Con qué aspecto del juego está relacionada tu sugerencia?\n-¿Qué problema en concreto intentas arreglar?\n-¿Cómo crees que se podría mejorar esto de forma divertida y equitativa?";
HELPFRAME_REPORT_PLAYER_TEXT1 = "World of Warcraft debería ser siempre un entorno divertido, justo y seguro. Si encuentras a un jugador que está usando un |cffffd200nombre ofensivo|r, |cffffd200enviando spam|r en el chat, |cffffd200haciendo trampas|r o usando un |cffffd200lenguaje grosero|r, existe una forma rápida y fácil de informar del problema a Blizzard para que haga un seguimiento.\n\nPara informar de un jugador por no respetar las normas o tener un comportamiento ofensivo, |cffffd200haz clic derecho en el nombre del jugador|r en el chat o |cffffd200haz clic derecho en el retrato del jugador|r y elige la opción |cffffd200Informar de jugador|r.";
