CLASS_DEATHKNIGHT = "Estos antiguos agentes de la Plaga son ahora aliados de la Alianza o de la Horda. Los caballeros de la Muerte son una clase héroe, por lo que comienzan con un nivel alto. Usan runas como recurso principal, y cada uno de los tres tipos de runas se utiliza para facultades diferentes.|n|nLos caballeros de la Muerte tienen más capacidades a distancia que la mayoría de las clases cuerpo a cuerpo, destacan en el uso de enfermedades e infligen daño con sus mascotas no-muertas. Su estadística principal es la fuerza y también el aguante si hacen las veces de tanque.";
CLASS_DEATHKNIGHT_FEMALE = "Estos antiguos agentes de la Plaga son ahora aliados de la Alianza o de la Horda. Los caballeros de la Muerte son una clase héroe, por lo que comienzan con un nivel alto. Usan runas como recurso principal, y cada uno de los tres tipos de runas se utiliza para facultades diferentes.|n|nLos caballeros de la Muerte tienen más capacidades a distancia que la mayoría de las clases cuerpo a cuerpo, destacan en el uso de enfermedades e infligen daño con sus mascotas no-muertas. Su estadística principal es la fuerza y también el aguante si hacen las veces de tanque.";
CLASS_DEATHKNIGHT_SPELLDESC1 = "Invoca una legión de necrófagos para que luchen a tu lado durante un breve período.";
CLASS_DEATHKNIGHT_SPELLDESC2 = "Corrompe el suelo que pisas, lo que inflige daño a todos los enemigos cercanos.";
CLASS_DEATHKNIGHT_SPELLDESC3 = "Estiras el brazo para agarrar a tu objetivo y atraerlo hacia ti.";
CLASS_DEATHKNIGHT_SPELLNAME1 = "Ejército de muertos";
CLASS_DEATHKNIGHT_SPELLNAME2 = "Muerte y descomposición";
CLASS_DEATHKNIGHT_SPELLNAME3 = "Atracción letal";
CLASS_DEMONHUNTER = "Los cazadores de demonios son una clase héroe, lo que significa que comienzan con un nivel alto. Son exiliados oscuros que usan magia demoníaca prohibida para cazar y matar a sus enemigos.";
CLASS_DEMONHUNTER_SPELLDESC1 = "Cargas rápidamente hacia adelante y quemas a los enemigos que encuentres a tu paso.";
CLASS_DEMONHUNTER_SPELLDESC2 = "Libera un haz de magia vil en bruto e incinera a todos los enemigos frente a ti.";
CLASS_DEMONHUNTER_SPELLDESC3 = "Atacas con un salto y te transformas en un demonio, adquiriendo poderosos ataques al aterrizar.";
CLASS_DEMONHUNTER_SPELLNAME1 = "Carga vil";
CLASS_DEMONHUNTER_SPELLNAME2 = "Haz ocular";
CLASS_DEMONHUNTER_SPELLNAME3 = "Metamorfosis";
CLASS_DISABLED = "Selecciona una de las siguientes razas para poder jugar esta clase:";
