CLASS_DRUID = "Los druidas cambian de forma y sienten afinidad por el reino animal y vegetal. Existen tres tipos de druidas: los druidas Equilibrio, que lanzan hechizos de Naturaleza o Arcanos a distancia; los druidas Ferales, que pueden adoptar la forma de un felino o de un oso en cuerpo a cuerpo; y los druidas Restauración, que pueden sanar a sus aliados y destacan en los hechizos de sanación en el tiempo. Las estadísticas principales de los druidas dependen de su función.";
CLASS_DRUID_FEMALE = "Los druidas cambian de forma y sienten afinidad por el reino animal y vegetal. Existen tres tipos de druidas: los druidas Equilibrio, que lanzan hechizos de Naturaleza o Arcanos a distancia; los druidas Ferales, que pueden adoptar la forma de un felino o de un oso en cuerpo a cuerpo; y los druidas Restauración, que pueden sanar a sus aliados y destacan en los hechizos de sanación en el tiempo. Las estadísticas principales de los druidas dependen de su función.";
