CLASS_PALADIN = "Los paladines son luchadores de armadura pesada que apelan a la magia Sagrada para sanar sus heridas y combatir el mal. Son relativamente autosuficientes, y tienen muchas facultades para evitar la muerte. Pueden centrarse en armas de dos manos, escudos o sanación. Sus estadísticas principales dependen de su función.";
CLASS_PALADIN_FEMALE = "Los paladines son luchadores de armadura pesada que apelan a la magia Sagrada para sanar sus heridas y combatir el mal. Son relativamente autosuficientes, y tienen muchas facultades para evitar la muerte. Pueden centrarse en armas de dos manos, escudos o sanación. Sus estadísticas principales dependen de su función.";
