CLASS_SHAMAN = "Los chamanes utilizan el poder de los elementos para mejorar su daño con armas o con hechizos. Invocan tótems en combate: pequeños objetos que aplican beneficios, sanan, o infligen daño a los enemigos. Los chamanes suelen cumplir el papel de líder espiritual de sus comunidades tribales. Sus estadísticas principales dependen de su función.";
