CLASS_WARLOCK_FEMALE = "Los brujos lanzan magia de Fuego o de las Sombras para dañar, drenar o maldecir al enemigo. Pueden drenar las almas para potenciar sus hechizos. Los brujos pueden convertir su salud en maná o invocar a los miembros de su grupo a su ubicación.|n|nLos brujos son temidos en algunos círculos de la Alianza, mientras que son considerados grandes líderes en partes de la Horda. Como taumaturgos, las estadísticas principales del brujo son el poder con hechizos y el intelecto.";
