RACE_INFO_BLOODELF = "Hace mucho tiempo, los elfos nobles exiliados fundaron Quel'Thalas y allí crearon una fuente mágica, La Fuente del Sol. A pesar de que sus poderes los fortalecieron, desarrollaron una fuerte adicción a ellos.|n|nAños más tarde, la Plaga de los no-muertos destruyó La Fuente del Sol y casi la totalidad de la población de elfos nobles. Ahora, conocidos como los elfos de sangre, estos refugiados dispersos intentan reconstruir Quel'Thalas a la par que buscan una nueva fuente mágica que calme su dolorosa adicción.";
RACE_INFO_BLOODELF_FEMALE = "Hace mucho tiempo, los elfos nobles exiliados fundaron Quel'Thalas y allí crearon una fuente mágica, La Fuente del Sol. A pesar de que sus poderes los fortalecieron, desarrollaron una fuerte adicción a ellos.|n|nAños más tarde, la Plaga de los no-muertos destruyó La Fuente del Sol y casi la totalidad de la población de elfos nobles. Ahora, conocidos como los elfos de sangre, estos refugiados dispersos intentan reconstruir Quel'Thalas a la par que buscan una nueva fuente mágica que calme su dolorosa adicción.";
RACE_INFO_DRAENEI = "Lejos de su hogar, Argus, los honorables draenei huyeron de la Legión Ardiente durante eones antes de encontrar un planeta remoto donde asentarse. Compartieron ese mundo con los chamanísticos orcos y lo llamaron Draenor. Con el tiempo, la Legión corrompió a los orcos, quienes hicieron la guerra y casi exterminaron a los pacíficos draenei. Unos pocos afortunados escaparon y llegaron a Azeroth, donde ahora buscan aliados en su batalla contra la Legión Ardiente.";
RACE_INFO_DRAENEI_FEMALE = "Lejos de su hogar, Argus, los honorables draenei huyeron de la Legión Ardiente durante eones antes de encontrar un planeta remoto donde asentarse. Compartieron ese mundo con los chamanísticos orcos y lo llamaron Draenor. Con el tiempo, la Legión corrompió a los orcos, quienes hicieron la guerra y casi exterminaron a los pacíficos draenei. Unos pocos afortunados escaparon y llegaron a Azeroth donde ahora buscan aliados en su batalla contra la Legión Ardiente.";
RACE_INFO_DWARF = "En el pasado, los enanos solo se preocupaban por las riquezas extraídas de las entrañas de la tierra. Fue así como hallaron vestigios de una raza divina que, según parece, les dio vida... y derecho de nacimiento encantado. Impulsados a aprender más por este descubrimiento, los enanos se consagraron a la búsqueda de artefactos perdidos y el conocimiento arcano. Hoy en día, hay arqueólogos enanos repartidos por todo el mundo.";
RACE_INFO_DWARF_FEMALE = "En el pasado, los enanos solo se preocupaban por las riquezas extraídas de las entrañas de la tierra. Fue así como hallaron vestigios de una raza divina que, según parece, les dio vida... y derecho de nacimiento encantado. Impulsados a aprender más por este descubrimiento, los enanos se consagraron a la búsqueda de artefactos perdidos y el conocimiento arcano. Hoy en día, hay arqueólogos enanos repartidos por todo el mundo.";
RACE_INFO_GNOME = "A pesar de su baja estatura, los gnomos de Khaz Modan usaron su prodigioso intelecto para asegurarse un lugar en la Historia. Sin ninguna duda, su reino subterráneo, Gnomeregan, era una maravilla de la tecnología a vapor. Pero así y todo, perdieron la ciudad durante una invasión masiva de troggs. Ahora, los creadores de esta maravilla vagan por las tierras de los enanos, ayudándoles lo mejor que pueden.";
RACE_INFO_GNOME_FEMALE = "A pesar de su baja estatura, los gnomos de Khaz Modan usaron su prodigioso intelecto para asegurarse un lugar en la Historia. Sin ninguna duda, su reino subterráneo, Gnomeregan, era una maravilla de la tecnología a vapor. Pero así y todo, perdieron la ciudad durante una invasión masiva de troggs. Ahora, los creadores de esta maravilla vagan por las tierras de los enanos, ayudándoles lo mejor que pueden.";
RACE_INFO_GOBLIN = "Los goblins, que originalmente fueron los esclavos de los trols de la selva en la Isla de Kezan, se vieron forzados a trabajar en las minas de kaja'mita de Minahonda, en las entrañas del Monte Kajaro. Lo que nadie sabía en aquella época era que el mineral tenía propiedades mágicas que aumentaban rápidamente el ingenio y la inteligencia de los goblins. En secreto, crearon poderosos artefactos de ingeniería y alquimia y derrocaron a los opresores trols, conquistando así la isla que ahora consideran su hogar. Rápidamente destacaron por su maestría en el mercantilismo y, con sus conglomerados de compraventa globales, ahora dominan todo el comercio a lo largo y ancho de Azeroth.";
RACE_INFO_HUMAN = "Los humanos son una raza joven y, por lo tanto, muy versátil que domina las artes del combate, la artesanía y la magia con asombrosa eficiencia. Derrochan valor y optimismo a raudales, lo que les ha valido para llegar a construir algunos de los reinos más majestuosos del mundo. En esta era de tribulaciones, tras generaciones de conflicto, la humanidad ansía recuperar su vieja gloria y forjar un nuevo futuro lleno de esplendor.";
RACE_INFO_HUMAN_FEMALE = "Los humanos son una raza joven y, por lo tanto, muy versátil que domina las artes del combate, la artesanía y la magia con asombrosa eficiencia. Derrochan valor y optimismo a raudales, lo que les ha valido para llegar a construir algunos de los reinos más majestuosos del mundo. En esta era de tribulaciones, tras generaciones de conflicto, la humanidad ansía recuperar su vieja gloria y forjar un nuevo futuro lleno de esplendor.";
RACE_INFO_NIGHTELF = "Hace diez mil años, los elfos de la noche fundaron un vasto Imperio, pero el uso imprudente de la magia primaria los llevó a la ruina. Consternados, se retiraron a los bosques donde se aislaron hasta el regreso de su antiguo enemigo: la Legión Ardiente. Entonces no tuvieron más opción que abandonar su reclusión y luchar por su lugar en el nuevo mundo.";
RACE_INFO_NIGHTELF_FEMALE = "Hace diez mil años, los elfos de la noche fundaron un vasto Imperio, pero el uso imprudente de la magia primaria los llevó a la ruina. Consternados, se retiraron a los bosques donde se aislaron hasta el regreso de su antiguo enemigo: la Legión Ardiente. Entonces no tuvieron más opción que abandonar su reclusión y luchar por su lugar en el nuevo mundo.";
RACE_INFO_ORC = "La raza de los orcos es originaria del planeta Draenor. Este pueblo pacífico, de creencias chamánicas, fue esclavizado por la Legión Ardiente y forzado a participar en la guerra contra los humanos de Azeroth. Aunque tuvieron que pasar muchos años, al final escaparon de la corrupción de los demonios y recuperaron su libertad. A día de hoy, luchan por su honor en un mundo que los odia y desprecia.";
RACE_INFO_ORC_FEMALE = "La raza de los orcos es originaria del planeta Draenor. Este pueblo pacífico, de creencias chamánicas, fue esclavizado por la Legión Ardiente y forzado a participar en la guerra contra los humanos de Azeroth. Aunque tuvieron que pasar muchos años, al final escaparon de la corrupción de los demonios y recuperaron su libertad. A día de hoy, luchan por su honor en un mundo que los odia y desprecia.";
SERVER_SPLIT_CURRENT_CHOICE = "Selección actual:\n%s";
RACE_INFO_PANDAREN = "Envuelto en niebla durante eras, el antiguo reino de Pandaria ha conseguido mantenerse al margen de la guerra. Ahora que la niebla se ha disipado, los héroes pandaren dan un paso adelante para jurar lealtad a la Alianza o a la Horda. Los pandaren más aventureros proceden de La Isla Errante, una tierra misteriosa ajena al resto del mundo e incluso a Pandaria.";
RACE_INFO_SCOURGE = "Fuera del alcance del Rey Exánime, los Renegados buscan la manera de derrocarlo. El alma en pena Sylvanas lidera su sed de venganza contra la Plaga. Los humanos ahora también son el enemigo, implacables en su intento de purgar de no-muertos el mundo. A los Renegados les importan poco incluso sus aliados; para ellos, la Horda no es más que una herramienta para promover sus oscuros planes.";
RACE_INFO_SCOURGE_FEMALE = "Fuera del alcance del Rey Exánime, los Renegados buscan la manera de derrocarlo. El alma en pena Sylvanas lidera su sed de venganza contra la Plaga. Los humanos ahora también son el enemigo, implacables en su intento de purgar de no-muertos el mundo. A los Renegados les importan poco incluso sus aliados; para ellos, la Horda no es más que una herramienta para promover sus oscuros planes.";
RACE_INFO_TAUREN = "Los tauren se esfuerzan continuamente para preservar el equilibrio de la Naturaleza y respetar los deseos de la diosa que veneran, la Madre Tierra. Hace poco fueron atacados por mortíferos centauros y habrían sido aniquilados si no hubiese sido por un encuentro fortuito con los orcos, que les ayudaron a derrotar a los intrusos. Para hacer honor a esta deuda de sangre, los tauren se unieron a la Horda, afianzando la amistad de ambas razas.";
RACE_INFO_TAUREN_FEMALE = "Los tauren se esfuerzan continuamente para preservar el equilibrio de la Naturaleza y respetar los deseos de la diosa que veneran, la Madre Tierra. Hace poco fueron atacados por mortíferos centauros y habrían sido aniquilados si no hubiese sido por un encuentro fortuito con los orcos, que les ayudaron a derrotar a los intrusos. Para hacer honor a esta deuda de sangre, los tauren se unieron a la Horda, afianzando la amistad de ambas razas.";
RACE_INFO_TROLL = "Los fieros trols de la tribu Lanza Negra habitaban las junglas de la Vega de Tuercespina hasta que facciones guerreras los expulsaron de allí. Con el tiempo, los trols entablaron amistad con la Horda de los orcos y Thrall, el joven jefe guerrero orco, los convenció para que viajasen con él a Kalimdor. A pesar de su inherente herencia oscura, los trols de la tribu Lanza Negra ocupan un lugar privilegiado en la Horda.";
RACE_INFO_TROLL_FEMALE = "Los fieros trols de la tribu Lanza Negra habitaban las junglas de la Vega de Tuercespina hasta que facciones guerreras los expulsaron de allí. Con el tiempo, los trols entablaron amistad con la Horda de los orcos y Thrall, el joven jefe guerrero orco, los convenció para que viajasen con él a Kalimdor. A pesar de su inherente herencia oscura, los trols de la tribu Lanza Negra ocupan un lugar privilegiado en la Horda.";
RACE_INFO_WORGEN = "Los huargen fueron liberados por el archimago Arugal en los Reinos del Este durante la Tercera Guerra. En un primer momento fueron un arma contra la Plaga, pero las bestias no tardaron en demostrar que suponían una carga demasiado pesada para los humanos de Lordaeron. Una misteriosa maldición comenzó a extenderse entre los que lucharon al lado de los hombres lobo: los convertía en huargen. La maldición se extendió rápidamente hasta alcanzar Gilneas y encerró a sus habitantes tras las murallas tan bien construidas para protegerlos. Los supervivientes de la maldición ahora buscan un nuevo destino para su pueblo, un destino no escrito...";
