SOCIAL_CONTRACT_TEXT1 = "|cffffffffSaludos. ¡Te damos la bienvenida al mundo de Warcraft!|r|n|n|cffffd200Azeroth es un mundo con vida propia repleto de personas como tú. Aquí encontrarás otros jugadores con distintos trasfondos, culturas, experiencias e historias que han reunido para jugar a World of Warcraft. Todos los jugadores se merecen un mundo en el que estén seguros, así que tómate un momento para leer nuestro contrato social.|r|n|n|n|cffffffffMientras estés en Azeroth, procura hacer lo siguiente:|r|n|n";
SOCIAL_CONTRACT_TEXT2 = "|cffffd200- ¡Entra en contacto con otros jugadores y haz amigos! Si te muestras amable en un grupo, tus compañeros y tú lo pasaréis mejor. Un mensaje con un saludo amistoso puede ayudar a un grupo a funcionar mejor.|n|n- Juega en equipo con el resto de jugadores, ya sea en mazmorras, bandas, campos de batalla, arenas o misiones en el mundo. Hazlo lo mejor posible para apoyar a tu equipo utilizando la comunicación y las buenas formas para que todos podáis alcanzar el éxito.|n|n- Ayuda a otros jugadores que te encuentres en el mundo. Puede que necesiten ayuda para derrotar a un monstruo complicado o quizá solo un poco de sanación.|n|n- Colabora respondiendo a preguntas de otros jugadores en los canales del chat general o de comercio. Todos hemos sido novatos: ¡que alguien ofrezca su ayuda puede ser muy importante!|n|n";
SOCIAL_CONTRACT_TEXT3 = "Sabemos que Internet no siempre es un lugar seguro. Por ello, no se aceptan los siguientes comportamientos en Azeroth:|n|n- Apologías del odio, incluidos los comentarios negativos que afecten a aspectos de la identidad de los otros jugadores, como la raza, el género o la habilidad.|n|n- Acoso, amenazas o lenguajes y comportamientos abusivos u ofensivos.|n|n- Publicidad abusiva o de cualquier otro tipo u otros comportamientos negativos.|n|nSi agredes a otros aventureros con cualquiera de los comportamientos descritos anteriormente, te arriesgas a recibir sanciones que podrían desembocar en la suspensión de la cuenta.|n|nEl mundo es enorme y lo habita todo tipo de personas. Procura ser respetuoso con los demás y, si te parece que alguien está vulnerando este código, informa sobre ello para que nuestro equipo pueda investigarlo. Juntos, haremos que World of Warcraft sea un segundo hogar seguro para todos.|r";
