OPTION_TOOLTIP_COMPAT_SETTING_OPTIONAL_GPU_FEATURES = "Permite utilizar las características más recientes de la GPU. Si se desactiva, el juego actuará como si la GPU solo contara con las características mínimas necesarias. Se desactivarán varias características gráficas y es probable que se reduzca la calidad visual del juego. Esto puede ayudar a solucionar errores de controladores u otros problemas relacionados con características más recientes de la GPU.";
OPTION_TOOLTIP_COMPAT_SETTING_DEVICE_MULTITHREADING = "Permite la creación asíncrona de recursos de la GPU, como texturas y sombras. Si se desactiva, es probable que se produzcan problemas de rendimiento, pero tal vez se solucionen fallos o errores visuales relacionados con controladores o hardware antiguos.";
