PVP_REALM_WARNING = "Un momento, aventurero. Estás a punto de unirte a un reino |cffffffffJcJ (jugador contra jugador) |cffffd200. Te verás bajo la amenaza constante de los jugadores de la facción opuesta.|n|nSi no es lo tuyo lidiar con un elevado nivel de conflicto, te recomendamos que elijas un reino |cffffffffnormal (sin JcJ) |cffffd200.|n|n|cffffffffLos maestros de juego no intervienen en conflictos JcJ y la transferencia de personajes entre reinos JcJ y normales no está permitida.";
PVP_CHARACTER_CREATION_WARNING = "¡Te damos la bienvenida a |cffffffffWorld of Warcraft! |cffffd200Mientras te preparas para entrar, ten en cuenta que estás a punto de unirte a un reino |cffffffffJcJ (jugador contra jugador)|cffffd200. Esto significa que, además de los desafíos del propio mundo, también te enfrentarás a la amenaza constante de otros jugadores.|n|n|cffffffffEl combate JcJ|cffffd200 es una parte fundamental de este reino, y los jugadores de la facción contraria pueden atacarte sin previo aviso y sin sentido del honor en zonas disputadas. Prepárate para escaramuzas y batallas potencialmente desiguales mientras exploras el mundo, ya sea durante misiones, recolectando recursos o viajando entre ubicaciones. Por ejemplo, aquel jugador al que mataste en el Cráter de Un'Goro mientras competíais por recolectar cueros de demosaurio podría guardarte rencor, y es posible que su hermandad te espere en la Montaña Roca Negra mientras te diriges a la banda de Núcleo de Magma para tenderte una emboscada.";
PVP_CHARACTER_CREATION_WARNING_TWO = "|n|nSi no te interesa este nivel de conflicto, te recomendamos que elijas un reino |cffffffffnormal (sin JcJ), |cffffd200donde el combate entre jugadores está restringido.|n|n|cffffffffLos maestros de juego no intervienen en conflictos JcJ y la transferencia de personajes entre reinos JcJ y normales no está permitida. ¡Te hemos avisado!";
